import IUnitInfo from "../../interface/IUnitInfo";
import DefaultStrategy from "../unitStrategy/DefaultStrategy";
import MageStrategy from "../unitStrategy/MageStrategy";
export default class ArchiMageUnitInfo extends DefaultStrategy
  implements IUnitInfo {
  _unitType: string;
  _HP: number;
  _damage: number;
  _initiative: number;
  _actionType: void;
  _name: string;
  constructor() {
    super(new MageStrategy());
    this._unitType = "mage";
    this._HP = 90;
    this._damage = 40;
    this._initiative = 40;
    this._name = "ArchiMage";
  }
}
